import React from 'react';
import ReactDOM from 'react-dom/client';
import './Styles/style.css';
import './Styles/responsive.css'
import App from './App';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
